import React from 'react'
import UserCabinetEdit from '../components/user-cabinet/UserCabinetEdit'
import { connect } from 'react-redux'
import { getAllUsersTasks } from '../redux/actions/actions'

function UserCabinet({ getAllUsersTasks }) {
  return (
    <div>
      <UserCabinetEdit getAllUsersTasks={getAllUsersTasks } />
    </div>
  )
}

const mapStateToProps = state => ({

})

const mapDispatchToProps = {
  getAllUsersTasks
}

export default connect(mapStateToProps, mapDispatchToProps)(UserCabinet);
